import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';



function MainSlider() {
  return (
      <div className="slider">
        <Carousel>
          <Carousel.Item
          style={{
            height: '100%',
          }}
          >
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_1.png',
                    amount: 0.5,
                },
            ]}

          >
  <h1
  style={{
      textAlign: 'center',
  }}>Georgia's #1 Family Owned Pawn Shop</h1>
</ParallaxBanner>
          </Carousel.Item>
          <Carousel.Item>
            <img
            className="d-block w-100"
            src="/images/03slide.png"
            alt="Third slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
            className="d-block w-100"
            src="/images/14slide.png"
            alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>
      </div>
  );
}

export default MainSlider;
